<style>.webgl-content * {border: 0; margin: 0; padding: 0}
.webgl-content {position: absolute; top: 50%; left: 50%; -webkit-transform: translate(-50%, -50%); transform: translate(-50%, -50%);}

.webgl-content .logo, .progress {position: absolute; left: 50%; top: 50%; -webkit-transform: translate(-50%, -50%); transform: translate(-50%, -50%);}
.webgl-content .logo {background: url('progressLogo.Light.png') no-repeat center / contain; width: 154px; height: 130px;}
.webgl-content .progress {height: 18px; width: 141px; margin-top: 90px;}
.webgl-content .progress .empty {background: url('progressEmpty.Light.png') no-repeat right / cover; float: right; width: 100%; height: 100%; display: inline-block;}

.webgl-content .footer .webgl-logo, .title, .fullscreen {height: 100%; display: inline-block; background: transparent center no-repeat;}

.webgl-content .footer .title {margin-right: 10px; float: right;}

<script>
function UnityProgress(unityInstance, progress) {
  if (!unityInstance.Module)
    return;
  if (!unityInstance.logo) {
    unityInstance.logo = document.createElement("div");
    unityInstance.logo.className = "logo " + unityInstance.Module.splashScreenStyle;
    unityInstance.container.appendChild(unityInstance.logo);
  }
  if (!unityInstance.progress) {    
    unityInstance.progress = document.createElement("div");
    unityInstance.progress.className = "progress " + unityInstance.Module.splashScreenStyle;
    unityInstance.progress.empty = document.createElement("div");
    unityInstance.progress.empty.className = "empty";
    unityInstance.progress.appendChild(unityInstance.progress.empty);
    unityInstance.progress.full = document.createElement("div");
    unityInstance.progress.full.className = "full";
    unityInstance.progress.appendChild(unityInstance.progress.full);
    unityInstance.container.appendChild(unityInstance.progress);
  }
  unityInstance.progress.full.style.width = (100 * progress) + "%";
  unityInstance.progress.empty.style.width = (100 * (1 - progress)) + "%";
  if (progress == 1)
    unityInstance.logo.style.display = unityInstance.progress.style.display = "none";
}
</script>

function blobToDataUrl(blob) {
    return new Promise((resolve) => {
        const reader = new FileReader();
        reader.onloadend = () => resolve(reader.result);  
        reader.readAsDataURL(blob);
    });
}

async function unzipWebpFromUrl(dataUri) {
    const blobUrls = {};
	var realdatauri = await blobToDataUrl(dataUri)
   
    const base64 = realdatauri.split(',')[1];
    const binaryString = atob(base64);
    const len = binaryString.length;
    const bytes = new Uint8Array(len);
    for (let i = 0; i < len; i++) {
        bytes[i] = binaryString.charCodeAt(i);
    }

   
    const zip = await JSZip.loadAsync(bytes);


    for (const [filename, file] of Object.entries(zip.files)) {
    if (!file.dir) {
        let mime = '';

        if (filename.endsWith('.js') || filename.endsWith('.mjs')) {
            mime = 'text/javascript';
        } else if (filename.endsWith('.css')) {
            mime = 'text/css';
        } else if (filename.endsWith('.html')) {
            mime = 'text/html';
        } else if (filename.endsWith('.webp')) {
            mime = 'image/webp';
        } else if (filename.endsWith('.png')) {
            mime = 'image/png';
        } else if (filename.endsWith('.jpg') || filename.endsWith('.jpeg')) {
            mime = 'image/jpeg';
        }
      

        const rawBlob = await file.async("blob");
        const blob = mime ? new Blob([rawBlob], { type: mime }) : rawBlob;

        const blobUrl = URL.createObjectURL(blob);
        console.log(filename);
        blobUrls[filename] = blobUrl;
    }
}


    return blobUrls;
}


const BASE91_TABLE =
"ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789" +
"!#$%&()*+,./:;<=>?@[]^_`{|}~\"";

 
const BASE91_DECODE = {};
for (let i = 0; i < BASE91_TABLE.length; i++) {
    BASE91_DECODE[BASE91_TABLE[i]] = i;
}

function base91DecodeToBlobURL(base91String, mime = "application/octet-stream") {
    let v = -1, b = 0, n = 0;
    let out = [];

    for (let i = 0; i < base91String.length; i++) {
        let c = BASE91_DECODE[base91String[i]];
        if (c === undefined) continue;

        if (v < 0) v = c;
        else {
            v += c * 91;
            b |= v << n;
            n += (v & 8191) > 88 ? 13 : 14;

            while (n >= 8) {
                out.push(b & 255);
                b >>= 8;
                n -= 8;
            }
            v = -1;
        }
    }

    if (v >= 0)
        out.push((b | (v <<
 n)) & 255);

     
    const blob = new Blob([new Uint8Array(out)], { type: mime });
